,p_display_point=>'BODY'
,p_source=>wwv_flow_utilities.join(wwv_flow_t_varchar2(
'select fl.id',
',      fl.id  id_display',
',      fl.etag',
',      fl.selflink',
',      fl.alternatelink',
',      fl.embedlink',
',      fl.iconlink',
',      fl.thumbnaillink',
',      fl.title',
',      fl.mimetype',
',      fl.labels.starred',
',      fl.labels.hidden',
',      fl.labels.trashed',
',      fl.labels.restricted',
',      fl.labels.viewed',
',      fl.createddate',
',      fl.modifieddate',
',      fl.modifiedbymedate',
',      fl.lastviewedbymedate',
',      fl.markedviewedbymedate',
',      fl.version',
',      fl.exportlinks.plain',
',      fl.exportlinks.csv',
',      fl.exportlinks.pdf',
',      fl.exportlinks.openxml',
',      fl.quotabytes_used',
',      fl.lastmodifyingusername',
',      fl.lastmodifyinguser.displayname',
',      coalesce(fl.lastmodifyinguser.picture, ''/i/1px_trans.gif'') as lastmodifyinguser_picture',
',      fl.lastmodifyinguser.emailAddress',
',      fl.editable',
',      fl.copyable',
',      fl.writerscanshare',
',      fl.shared',
',      fl.appdatacontents',
',      case fl.mimetype',
'         when ''application/vnd.google-apps.folder'' then ',
'                       ''<a href ="f?p=&APP_ID.:15:'' || :APP_SESSION || ''::NO:RP:P15_FOLDER_ID:'' || fl.id || ''">''',
'                    || ''<img src="'' || fl.iconlink || ''"/>''',
'                    || ''</a>''',
'         else ''<a href="https://drive.google.com/open?id='' || fl.id || ''&authuser=0" target="_blank">''',
'           || ''<img src="'' || fl.iconlink || ''"/>''',
'           || ''</a>''',
'       end as link',
'from   table(s4sg_drive_pck.file_list',
'               ( p_oauth_token => s4sa_oauth_pck.oauth_token(''GOOGLE'')',
'               , p_folder_id   => :P15_FOLDER_ID',
'               )',
'            ) fl',
'',
'where  fl.labels.hidden  = ''N''',
'  and  fl.labels.trashed = ''N''',
'order by case fl.mimetype',
'           when ''application/vnd.google-apps.folder'' then 0',
'           else 1',
'         end ',
'         , upper(fl.title)'))
